import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

interface InterpretationPopupProps {
  isOpen: boolean;
  personaName: string;
  onConfirm: () => void;
  onCancel: () => void;
  onComplete: (interpretation: string) => void;
}

const PopupOverlay = styled.div<{ isOpen: boolean }>`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: rgba(0, 0, 0, 0.5);
  display: ${props => props.isOpen ? 'flex' : 'none'};
  justify-content: center;
  align-items: center;
  z-index: 1000;
`;

const PopupContainer = styled.div`
  background: white;
  border-radius: 16px;
  padding: 32px;
  min-width: 400px;
  max-width: 500px;
  box-shadow: 0 8px 32px rgba(0, 0, 0, 0.3);
  text-align: center;
`;

const PopupTitle = styled.h2`
  font-size: 24px;
  font-weight: 700;
  color: #333;
  margin-bottom: 16px;
`;

const PopupDescription = styled.p`
  font-size: 16px;
  color: #666;
  margin-bottom: 24px;
  line-height: 1.5;
`;

const ButtonContainer = styled.div`
  display: flex;
  gap: 12px;
  justify-content: center;
`;

const Button = styled.button<{ variant: 'primary' | 'secondary' }>`
  padding: 12px 24px;
  border-radius: 8px;
  font-size: 16px;
  font-weight: 600;
  border: none;
  cursor: pointer;
  transition: all 0.2s ease;
  min-width: 100px;
  
  ${props => props.variant === 'primary' 
    ? `
      background: linear-gradient(135deg, #6c757d 0%, #5a6268 100%);
      color: white;
      &:hover {
        transform: translateY(-1px);
        box-shadow: 0 4px 12px rgba(108, 117, 125, 0.4);
      }
    `
    : `
      background: #f5f5f5;
      color: #666;
      &:hover {
        background: #e8e8e8;
      }
    `
  }
`;

const ProgressContainer = styled.div`
  margin: 24px 0;
`;

const ProgressText = styled.div`
  font-size: 32px;
  font-weight: 700;
  color: #6c757d;
  margin-bottom: 16px;
`;

const ProgressBar = styled.div`
  width: 100%;
  height: 8px;
  background: #e0e0e0;
  border-radius: 4px;
  overflow: hidden;
`;

const ProgressFill = styled.div<{ progress: number }>`
  height: 100%;
  background: linear-gradient(90deg, #6c757d 0%, #5a6268 100%);
  width: ${props => props.progress}%;
  transition: width 0.3s ease;
`;

const InterpretationPopup: React.FC<InterpretationPopupProps> = ({
  isOpen,
  personaName,
  onConfirm,
  onCancel,
  onComplete,
}) => {
  const [step, setStep] = useState<'confirm' | 'progress' | 'complete'>('confirm');
  const [progress, setProgress] = useState(0);

  useEffect(() => {
    if (!isOpen) {
      setStep('confirm');
      setProgress(0);
    }
  }, [isOpen]);

  useEffect(() => {
    if (step === 'progress') {
      const interval = setInterval(() => {
        setProgress(prev => {
          if (prev >= 100) {
            clearInterval(interval);
            // 가짜 해석 데이터 생성
            const fakeInterpretation = `${personaName}의 관점에서 분석한 결과:

당신의 상황을 ${personaName}의 이론적 프레임워크로 해석해보면, 여러 흥미로운 측면들이 드러납니다.

먼저 무의식적 동기를 살펴보면, 표면적인 의식 레벨 너머에 숨겨진 갈등과 욕구들이 존재할 가능성이 높습니다. 이는 과거의 경험들과 밀접한 연관이 있으며, 현재의 행동 패턴에 영향을 미치고 있습니다.

또한 방어기제의 관점에서 보면, 불안이나 위협적인 상황에 대처하기 위해 무의식적으로 특정한 심리적 전략들을 사용하고 있는 것으로 보입니다.

이러한 분석을 통해 더 깊은 자기 이해와 성장의 기회를 모색할 수 있을 것입니다.`;
            
            setTimeout(() => {
              setStep('complete');
              onComplete(fakeInterpretation);
            }, 500);
            return 100;
          }
          return prev + 2;
        });
      }, 100);

      return () => clearInterval(interval);
    }
  }, [step, personaName, onComplete]);

  const handleConfirm = () => {
    setStep('progress');
    onConfirm();
  };

  const handleCancel = () => {
    onCancel();
  };

  return (
    <PopupOverlay isOpen={isOpen}>
      <PopupContainer>
        {step === 'confirm' && (
          <>
            <PopupTitle>해석 생성 진행</PopupTitle>
            <PopupDescription>
              해당 인물의 사상에 기반한 심리 해석을 진행합니다.
            </PopupDescription>
            <ButtonContainer>
              <Button variant="primary" onClick={handleConfirm}>
                생성
              </Button>
              <Button variant="secondary" onClick={handleCancel}>
                취소
              </Button>
            </ButtonContainer>
          </>
        )}

        {step === 'progress' && (
          <>
            <PopupTitle>해석 생성 진행</PopupTitle>
            <ProgressContainer>
              <ProgressText>{progress}%</ProgressText>
              <ProgressBar>
                <ProgressFill progress={progress} />
              </ProgressBar>
            </ProgressContainer>
            <ButtonContainer>
              <Button variant="secondary" onClick={handleCancel}>
                확인
              </Button>
            </ButtonContainer>
          </>
        )}

        {step === 'complete' && (
          <>
            <PopupTitle>해석 생성 완료</PopupTitle>
            <PopupDescription>
              해석이 성공적으로 생성되었습니다.
            </PopupDescription>
            <ButtonContainer>
              <Button variant="primary" onClick={handleCancel}>
                확인
              </Button>
            </ButtonContainer>
          </>
        )}
      </PopupContainer>
    </PopupOverlay>
  );
};

export default InterpretationPopup;
